import axios from 'axios';

const TASK_API_BASE_URL = "http://localhost:9191/api/tasks"

class TaskService{
    getTasks(){
        return axios.get(TASK_API_BASE_URL);
    }
    postTask(task){
        return axios.post(TASK_API_BASE_URL,task);
    }
}

export default new TaskService()
